// --- Helper: Ensure UTC format ---
function ensureUTCFormat(dateString) {
    if (!dateString.endsWith('Z') && !dateString.match(/[+-]\d{2}:\d{2}$/)) {
        return dateString + 'Z';
    }
    return dateString;
}

const startUTCFormatted = ensureUTCFormat(startUTC);
const endUTCFormatted = ensureUTCFormat(endUTC);

// Convert to Date objects
const startDate = new Date(startUTCFormatted);
const endDate = new Date(endUTCFormatted);

if (isNaN(startDate.getTime()) || isNaN(endDate.getTime())) {
    throw new Error(`Invalid starttime or endtime format: ${startUTC}, ${endUTC}`);
}

// --- Conversion Helpers ---
// Case 1: Fixed UTC offset like "-04:00" or "+05:30"
function convertWithOffset(date, offsetString) {
    const match = offsetString.match(/([+-])(\d{2}):(\d{2})/);
    if (!match) throw new Error("Invalid offset format: " + offsetString);

    const sign = match[1] === "+" ? 1 : -1;
    const hours = parseInt(match[2], 10);
    const minutes = parseInt(match[3], 10);
    const totalOffsetMinutes = sign * (hours * 60 + minutes);

    // FIXED: Subtract the offset from UTC time
    // For timezone "-04:00", this subtracts -240 minutes (adds 240 minutes)
    const convertedDate = new Date(date.getTime() - totalOffsetMinutes * 60 * 1000);
    return formatDate(convertedDate);
}

// Case 2: IANA time zone like "America/Toronto"
function convertWithIANA(date, tz) {
    const parts = new Intl.DateTimeFormat('en-CA', {
        timeZone: tz,
        hour12: false,
        year: "numeric",
        month: "2-digit",
        day: "2-digit",
        hour: "2-digit",
        minute: "2-digit",
        second: "2-digit"
    }).formatToParts(date);

    const lookup = Object.fromEntries(parts.map(p => [p.type, p.value]));
    return `${lookup.year}-${lookup.month}-${lookup.day}T${lookup.hour}:${lookup.minute}:${lookup.second}`;
}

// Common formatter
function formatDate(date) {
    const year = date.getUTCFullYear();
    const month = String(date.getUTCMonth() + 1).padStart(2, '0');
    const day = String(date.getUTCDate()).padStart(2, '0');
    const hour = String(date.getUTCHours()).padStart(2, '0');
    const minute = String(date.getUTCMinutes()).padStart(2, '0');
    const second = String(date.getUTCSeconds()).padStart(2, '0');
    return `${year}-${month}-${day}T${hour}:${minute}:${second}`;
}

// --- Conversion Logic ---
let formattedStart, formattedEnd;

if (/^[+-]\d{2}:\d{2}$/.test(timeZone)) {
    // Fixed offset
    formattedStart = convertWithOffset(startDate, timeZone);
    formattedEnd = convertWithOffset(endDate, timeZone);
    console.log(`Converted using offset ${timeZone}`);
} else {
    // IANA zone
    formattedStart = convertWithIANA(startDate, timeZone);
    formattedEnd = convertWithIANA(endDate, timeZone);
    console.log(`Converted using IANA zone ${timeZone}`);
}

// --- Return ---
return [{
    formattedStartTime: formattedStart,
    formattedEndTime: formattedEnd,
    usedTimeZone: timeZone,
    originalStartTime: startUTC,
    originalEndTime: endUTC
}];

