// Function to adjust time based on timezone
function adjustTimeWithTimezone(startTime, endTime, timeZone) {
  // Use default timezone if undefined or invalid
  const validTimeZone = typeof timeZone === 'string' && /^[-+]\d{2}:\d{2}$/.test(timeZone) ? timeZone :  $('clientdata').first().json.Time_Zone;

  // Parse the timezone offset (e.g., "-04:00" or "+04:00")
  const sign = validTimeZone.startsWith('-') ? 1 : -1; // Negative timezone becomes positive, positive becomes negative
  const [hours, minutes] = validTimeZone.replace(/[-+]/, '').split(':').map(Number);
  const offsetMs = (hours * 60 + minutes) * 60 * 1000 * sign;

  // Parse the start and end times
  const startDate = new Date(startTime);
  const endDate = new Date(endTime);

  // Adjust times by adding the offset
  const adjustedStart = new Date(startDate.getTime() + offsetMs);
  const adjustedEnd = new Date(endDate.getTime() + offsetMs);

  // Format the adjusted times back to ISO string
  return {
    starttime: adjustedStart.toISOString(),
    endtime: adjustedEnd.toISOString()
  };
}

